import React from 'react';

function Dashboard() {
  const containerStyle = {
    fontFamily: "'Playfair Display', serif",
    color: '#1a1a1a',
    backgroundColor: '#fff',
    minHeight: '80vh',
    padding: '60px 20px',
    maxWidth: '900px',
    margin: '0 auto',
  };

  const headingStyle = {
    fontSize: '3rem',
    fontWeight: 300,
    marginBottom: '24px',
    textTransform: 'uppercase',
    letterSpacing: '0.1em',
    borderBottom: '1px solid #ccc',
    paddingBottom: '12px',
  };

  const infoStyle = {
    fontSize: '1.1rem',
    fontWeight: 300,
    color: '#555',
    lineHeight: 1.6,
  };

  return React.createElement(
    'div',
    { style: containerStyle },
    React.createElement('h2', { style: headingStyle }, 'Dashboard'),
    React.createElement(
      'p',
      { style: infoStyle },
      'Welcome to your Dior Dashboard. Here you can manage your products, view analytics, and monitor your boutique locations.'
    )
  );
}

export default Dashboard;
